const Prices = (props) => {
  const [coinData] = useState({
    currency: "USD",
  });

  return (
    <div>
      <ul>
        <li>
          Bitcoin rate for {props.bpi.bpi.USD.description} :{" "}
          {props.bpi.bpi.USD.code}
        </li>
      </ul>
    </div>
  );
};

export default Prices;
